class Solution {
public:
    int accountBalanceAfterPurchase(int purchaseAmount) {
        // Rounding to the nearest multiple of 10
        // If the last digit is 5 or more, we round up to the next multiple of 10
        int roundedAmount = (purchaseAmount + 4) / 10 * 10;

        // Calculate the new balance after the purchase
        int newBalance = 100 - roundedAmount;

        return newBalance;
    }
};
